import React from 'react'
import styles from './Testimonial.module.css'
const Testimonial = () => {
  return (
    <div>
      <div className={styles.bgname}> SAY'S</div>
      <div>Experience Our Excellence Through Testimonials</div>
    </div>
  )
}

export default Testimonial
